import ReactDOM from 'react-dom';

import Navbar from "./componets/Navbar";
import Storys from "./componets/Storys";
import Posts from "./componets/Posts";
import ConteudoPerfil from './componets/Perfil';
import Seguir from './componets/Seguir';

function App() {
  return (
    <div class = "body">
      <Navbar />
      <div class="conteudo">
        <Storys />
        <Posts />
        <div class="conta" >
          <ConteudoPerfil/>
          <Seguir/>
        </div>
      </div>

    </div>
  );
}

ReactDOM.render(<App />, document.querySelector(".root"));
